    protected function insertIfNotAllIdsInDB(array $data = null): bool
    {

        // it will chunk the dataset in smaller collections containing 500 values each.
        // Play with the value to get as large as possible
        $insert_data = collect($data); // Make a collection to use the chunk method

        $chunks = $insert_data->chunk(100);
        $res = false;
        foreach ($chunks as $chunk)
        {
            try {
                parent::tryToInsert($chunk->toArray());
            } catch (\Throwable $e) {
                parent::tryToInsert($chunk->toArray());
            }
        }
        return $res;
    }

